window.bookSummaryJSON = "<p><b>They’ve stolen my body. They’ve stolen my voice. They’ve stolen my spirit. I have nothing left to give.</b></p> <p>When Ava is rescued from the cruel clutches of her alpha father and the omega compound, her future is already set in stone. Shattered, traumatized, and hurting, she hides away from the world with the help of the Grey pack.</p> <p>Max, Lucien, Nikolai, and Bastien have their own pain to heal from, but the tiny omega in their midst gives them hope for a better life, a new life. If only Ava could see that, too.</p> <p>When the darkness of their world threatens to destroy them, Ava must decide where she stands. With help from old friends and the support of her pack, it’s time to fight back and make her voice heard.</p> <p>Who will be left standing when the omega creed falls?</p>"; 
